INSERT INTO `object_query_1` VALUES
(17,'1','Product',12,'Deeplyzen Day Spa','DeeplyZen Day Spa foi criado com a missão de permitir o cuidado da beleza, da saúde e do bem-estar, aliviando a tensão do dia a dia sem ter que sair da cidade. Também é para ajudar cada pessoa a encontrar seu equilíbrio pessoal, familiar e profissional.\n\nEquipado com salas dedicadas a diferentes especialidades, o Spa tem vários tratamentos, como massagens terapêuticas, massagens Vichy, tratamentos faciais e corporais, banho turco, sala de relaxamento, entre outros.\n\nDeeplyZen Day Spa se destaca em benefício de cada cliente, de tratamentos e pacotes específicos; Profundamente personalizado para cada caso e gosto pessoal. Acreditamos que o corpo e a alma são nossos bens mais preciosos e, portanto, promovemos a harmonia entre corpo, mente e espírito.\n\nConheça este espaço único, decorado para pensar em seu bem-estar em um ambiente que o ajude a esquecer a vida lá fora.\n\nMassagem, Tratamentos faciais e corporais, banho turco\n\nVenha explorar os seus sentidos...\n\nDê um novo toque ao seu corpo...\n\nUm novo rumo à sua alma...\n\nE mergulhe num estado profundamente zen...\n\nConnosco!',59.00,6,'object',NULL,8,'object'),
(18,'1','Product',44,'Taberna Belga','A melhor francesinha do norte\n\nA Francesinha e o nosso molho ímpar são os protagonistas da Taberna Belga.\n\nCom um sabor intenso e uma textura macia, a primeira garfada desta especialidade permite uma experiência singular e surpreendente.\n\nA escolha dos melhores ingredientes e a inalterável receita secreta do nosso molho, continuam a fazer superar as expectativas de todos que por aqui passam. ',13.00,6,'object',NULL,7,'object'),
(23,'1','Product',23,'Mariot Hotel','Um fim de semana para resuperar energias.\n\nPreço por noite',350.00,22,'object',NULL,21,'object'),
(24,'1','Product',3,'Aquashow','O Aquashow Parque é o melhor e maior Parque Aquático e Parque Temático de Portugal, no Algarve, em Quarteira.\n\nEstamos abertos de 1 de Maio a 30 de Setembro a partir das 10h00, com horários de encerramento diferentes consoante o mês.\n\nNo Parque Aquático encontra a maior diversidade de escorregas para todas as idades e a maior Piscina de Ondas de Portugal onde toda a família se pode divertir em conjunto. Em cada ano inauguramos sempre novas atracções e 2016 não vai ser excepção, vamos inaugurar um escorrega, inédito em Portugal, onde irá desfrutar de novas experiências (para maiores de 1,20m) e para os mais pequenos vamos instalar diversos escorregas e despertar um mundo de sensações aquáticas.',50.00,5,'object',NULL,19,'object'),
(25,'1','Product',53,'Oceanário Lisboa','Oceanário de Lisboa - Uma Viagem Única ao Fundo do Mar\n\nUm presente para viver o oceano, “mergulhar” no fundo do mar, sentir o seu pulsar e a importância de algo maior - a conservação do oceano!',8.00,22,'object',NULL,20,'object'),
(26,'1','Product',5,'Badoca Parque','O Badoca Safari Park é um parque temático com uma área de 90 hectares, que convida os amantes da natureza a passar um dia diferente e a conhecer a beleza da vida animal, em plena liberdade. Localizado no Alentejo, em Vila Nova de Santo André, entre a planície e o mar, a pouco mais de 1 hora de Lisboa, o parque conta atualmente com cerca de 600 animais, num total de mais de 80 espécies distintas. Durante o Safari vemos e aprendemos mais sobre muitos animais selvagens em habitat natural como zebras, girafas, búfalos, orixes ou gnus, mas no parque habitam também aves exóticas e de rapina, primatas, lémures, suricatas, cangurus, e muitos mais – todos eles à sua espera!\n\nO parque conta com várias atividades, passeios, apresentações de animais e zonas de restauração, para que possa passar um dia em cheio em contacto com a natureza e vários animais.\n',50.00,22,'object',NULL,19,'object'),
(27,'1','Product',7,'Bragalandia','Um parque tematico no norte do pais ,venha desfrutar um dia cheio de emoçoes',45.00,6,'object',NULL,19,'object'),
(28,'1','Product',18,'Hotel Altura','Duas noites à beira mar, com pequeno almoco e almoco incluido.\n\nPreço por noite',350.00,5,'object',NULL,21,'object'),
(29,'1','Product',40,'Sakana Sushi em Lisboa','Sakana Sushi em Lisboa | 50 Peças de Sushi e Sashimi com Vista Panorâmica Sobre o Tejo\n\nO sushi de qualidade, a vista deslumbrante sobre o Tejo, o ambiente intimista e informal, fazem do Sakana Sushi em Lisboa a opção certa para jantar romântico a dois.',35.00,22,'object',NULL,7,'object'),
(30,'1','Product',45,'Termas do Gerês','O Termas & Spa do Gerês é constituído pelo Balneário Termal, recentemente reequipado e remodelado por um moderno spa. Para além da cura termal tradicional e dos programas terapêuticos, programas de prevenção e promoção da saúde, o Termas & Spa do Gerês dispõe de um menu de spa com serviços e produtos especialmente concebidos de forma a satisfazer as expectativas dos que buscam lazer, paz e bem-estar.\nDeixe-se levar pelo descanso.\nAproveite a beleza do Gerês, classificado com o nível mais elevado das áreas protegidas. ',23.00,6,'object',NULL,8,'object'),
(31,'1','Product',30,'Scubadiving','Na zona costeira do algarve',40.00,5,'object',NULL,19,'object'),
(32,'1','Product',51,'Workshop de Costura','Workshop de costura, aprenda a arte da costura.',15.00,22,'object',NULL,20,'object'),
(69,'1','Product',26,'Naturwaterpark','O Naturwaterpark funciona de maio a setembro e tem vários espaços: parque aquático, parque aventura, quinta pedagógica e parque de campismo. O parque aquático tem pistas rápidas, o super-rápido Kamikaze, o Togobán com bóias, o hidrotubo, piscinas e o jacuzzi. As diversões estão também em ponto pequeno, para os miúdos, e foi criada uma zona de relaxamento. No Parque Aventura tem atividades como slide, paintball, escalada, rappel, tiro ao alvo, BTT, orientação, minigolfe, jogos tradicionais e campo de jogos ao ar livre. Para entrar no Parque Aventura tem um preçário diferente, assim como na Quinta Pedagógica, onde pode andar a cavalo.',45.00,6,'object',NULL,19,'object'),
(70,'1','Product',48,'Water Park Gerês','O Water Park Gerês é um parque de insufláveis na Praia do Alqueirão, albufeira da Caniçada. Tem o Iceberg que é escorrega com 4,2m e uma almofada (flipper) e um rolo de 6 metros sobre a água (hurdle). 6m em cima do rolo sem cair. Também tem flyboard e stand up paddle.\n',12.00,6,'object',NULL,19,'object'),
(71,'1','Product',42,'Slide and Splash','O Slide & Splash abriu em 1986 e é um do mais antigos parques aquáticos do país, ainda em funcionamento. Em todas as épocas traz novidades nas suas diversões. As atrações mais procuradas são o Kamikaze (tubos com 18 m de altura), o Torpedo (com 123 metros), o tubo Tornado, o Black Hole (tubo tapado), pistas e o escorrega radical que é o Caracol (com 150m de comprimento).\n',17.00,5,'object',NULL,19,'object'),
(72,'1','Product',19,'Jardim Zoologico Lisboa','Inaugurado em 1884, o Jardim Zoológico de Lisboa foi o primeiro parque com fauna e flora da Península Ibérica. Foram vários os seus fundadores - Dr. Pedro Van Der Laan, José Thomaz Sousa Martins e o Barão de Kessler - que contaram com o apoio de várias personalidades, o Rei D. Fernando II e o zoólogo José Vicente Barboza do Bocage.',24.00,22,'object',NULL,19,'object'),
(73,'1','Product',50,'Zoomarine','Assiste a apresentações com golfinhos, focas e leões marinhos, aves tropicais, aves de rapina e espetáculos acrobáticos.\n\nMomentos de ligação com as várias espécies que vão garantir memórias que ficam para sempre.',1650.00,5,'object',NULL,19,'object'),
(74,'1','Product',34,'Pena Aventura Park','O Pena Aventura Park e um parque de Actividades Ludicas e de Desporto Aventura/Natureza, onde a aventura nunca tem fim!E um destino único e uma referencia no Norte de Portugal, localizado em Ribeira de Pena, distrito de Vila Real, junto da saída da A7.',46.00,22,'object',NULL,19,'object'),
(75,'1','Product',25,'Thai Way Spa','Massagem à escolha - Lenda Thai ou Magia Aromática.\nEstas massagens são inspiradas em tradições medicinais da Tailândia e vão levá-la a descobrir novas sensações de bem-estar!',32.00,22,'object',NULL,8,'object'),
(76,'1','Product',21,'Pestana Spa','Magic Spa, experiencia de luxo c/ Circuito & Massagem |  2 Pessoas.\nTotalmente exclusivos e de excelência, os tratamentos dos Magic Spa by Pestana, fazem a diferença para quem procura um programa ideal para relaxar.',143.00,6,'object',NULL,8,'object'),
(77,'1','Product',14,'El Spa - Hotel Melia Aeroporto','Circuito de Águas + Massagem Relax\n\nDesfrute de um momento wellness muito especial, a sós ou a dois. O presente ideal para quem não dispensa uma experiência de Spa!',25.00,22,'object',NULL,8,'object'),
(78,'1','Product',27,'Neya Day Spa','Hidromassagem + Massagem Relax & Ritual de Chá\n\nNo requinte de um hotel de 4* em Lisboa, desfrute de uma inesquecível experiência de relaxamento e bem-estar no Neya Day Spa, sozinho ou a dois!',79.00,22,'object',NULL,8,'object'),
(79,'1','Product',43,'Spa para Bebés','Opção Massagem | Bebé + Pais! For Your Baby - Spa, Care & Relax\n\nSono, choro e cólicas? O spa para bebés ajuda o seu filhote no alívio destes sintomas, enquanto relaxa e se diverte. Os papás podem acompanhar o bebé!',44.00,22,'object',NULL,8,'object'),
(80,'1','Product',46,'Thalasso Spa','Acesso ao Circuito de Spa com Água do Mar\n\nNum cenário único, enquadrado pelo Atlântico, Thalasso é o local perfeito para reequilibrar o organismo e recuperar energias, em sintonia com o mar.',24.00,5,'object',NULL,8,'object'),
(81,'1','Product',29,'Nuad Thai Massage Therapy','sessão de massagem à escolha entre: cabeça, pescoço e ombros; reflexologia nos pés; massagem zen relaxante;\n\nFuja à agitação da cidade e entre num retiro de relaxamento e bem-estar que vai renovar as suas energias.',29.00,5,'object',NULL,8,'object'),
(82,'1','Product',22,'Mandalay Spa','Especial Pré-Mamã! Massagem para Grávida.\nDesligue-se de todas as preocupações e agitações do quotidiano, aproveitando ao máximo esta fase tão especial da sua vida.',42.00,22,'object',NULL,8,'object'),
(83,'1','Product',32,'Passeio pelo Douro','Passeio pelo Douro com Almoço a Bordo | Porto-Régua-Porto com Subida de Barco\n\nAlém de paisagens deslumbrantes, está incluído o pequeno-almoço, o almoço e um imenso prazer de passear por este rio Património Mundial!',62.00,6,'object',NULL,20,'object'),
(84,'1','Product',41,'Pack SLB','Pack SLB: Visita ao Museu e ao Estádio da Luz + Oferta de Cachecol\n\nUma visita ao Estádio da Luz e/ou Museu do Benfica com oferta de cachecol é o presente ideal para oferecer ao maior benfiquista que conhece!',10.00,22,'object',NULL,20,'object'),
(85,'1','Product',11,'Cruzeiro das 6 Pontes do Douro','Cruzeiro das 6 Pontes do Douro com Jantar a Bordo para Dois | RentDouro\n\nAdmire as seis pontes que unem o Porto e Vila Nova de Gaia ao sabor de um magnífico jantar a bordo.',59.00,6,'object',NULL,20,'object'),
(86,'1','Product',36,'Portugal dos Pequenitos','Portugal dos Pequenitos em Coimbra | Entradas Para Toda a Família!\n\nO Portugal dos Pequenitos, em Coimbra, é um espaço lúdico e pedagógico de cariz histórico muito agradável e divertido para passar um dia em família!',9.00,22,'object',NULL,20,'object'),
(87,'1','Product',16,'HIPPOtrip','HIPPOtrip | Passeio em Lisboa em Veículo Anfíbio com \"Mergulho\" no Rio Tejo\n\nÉ um barco e um autocarro! É o HIPPOtrip! Descubra Lisboa em família e prepare-se para \"mergulhar” no rio Tejo com um enorme sorriso!',29.00,22,'object',NULL,20,'object'),
(88,'1','Product',49,'Workshop Vínico','Workshop Vínico c/ Degustação & Visita à Adega Mayor para Dois | Campo Maior\n\nAlém da visita à Adega Mayor, esta experiência inclui um workshop de introdução ao mundo dos vinhos, com degustação de várias iguarias regionais.',32.00,5,'object',NULL,20,'object'),
(89,'1','Product',31,'Passeio Romântico a Cavalo','Passeio Romântico a Cavalo na Praia com Opção Sessão Fotos | 1h30 em Privado para Dois - Sines\n\nUm passeio a cavalo na praia privado é a sugestão ideal para surpreender a sua cara-metade! A Praia do Norte em Sines oferece o cenário romântico perfeito!',109.00,5,'object',NULL,20,'object'),
(90,'1','Product',37,'Visita e Prova de Vinho ','Visita e Prova de Vinho + Cruzeiro 3h30 | Macedo de Cavaleiros\n\nAproveite para fazer uma prova de vinhos e relaxar num cruzeiro pela Albufeira do Azibo com a sua família. Mime-se e embarque neste aventura vitivinícola!',35.00,6,'object',NULL,20,'object'),
(91,'1','Product',47,'Vinyl M Hotel','Vinyl M Hotel - Aveiro | Estadia com Banheira de Hidromassagem & Opção Pack Romântico\n\nO Vinyl M Hotel convida-o a usufruir do seu ambiente versátil, proporcionando conforto e prazer, integrando diferentes estilos de acordo com o seu perfil.\n\nPreço por noite',40.00,6,'object',NULL,21,'object'),
(92,'1','Product',13,'Hotel Eden','Hotel Eden - Luso | Estadia de Romance Junto às Termas\n\nCom a beleza da Serra do Buçaco e a vitalidade das termas conjugadas, no Luso encontra uma estadia que despertará todos os seus sentidos!\n\nPreço por noite',55.00,6,'object',NULL,21,'object'),
(93,'1','Product',39,'Quinta da Malhada','Quinta da Malhada - Vale do Paiva | Estadia Rústica em Casa de Xisto com Opção Pack Romântico\n\nNesta quinta encontrará um refúgio com toda a privacidade para uma escapadinha rural a dois ou em família!\n\nPreço por noite',45.00,6,'object',NULL,21,'object'),
(94,'1','Product',17,'Hotel Agrinho Suites & Spa','Hotel Agrinho Suites & Spa - Gerês | Estadia Romântica com Opção Jantar\n\nA poucos passos do Parque Nacional da Peneda-Gerês, o Hotel Agrinho Suites & Spa é a unidade perfeita para umas férias na natureza sem que falte o conforto e o requinte\n\nPreço por noite',67.00,6,'object',NULL,21,'object'),
(95,'1','Product',4,'Axis Ponte de Lima Golf Resort Hotel ','Axis Ponte de Lima Golf Resort Hotel | Escapadinha a Dois com Piscina Interior\n\nVisite o Minho em clima de romance! Convide quem mais ama e percam-se numa estadia de bem-estar e contacto com a natureza.\n\nPreço por noite',78.00,6,'object',NULL,21,'object'),
(96,'1','Product',15,'Grand Muthu Forte da Oura','Grand Muthu Forte da Oura 5* - Albufeira | Noites em Família com Tudo Incluído Junto à Praia\n\nDesfrute de uma estadia sossegada no Algarve. Um paraíso para toda a família, a poucos passos da praia!\n\nPreço por noite',109.00,5,'object',NULL,21,'object'),
(97,'1','Product',33,'Pelican Alvor','Pelican Alvor 4* | Férias em Família em Estúdio Vista Piscina & Opção Pequeno-Almoço\n\nViva o Algarve longe dos grandes centros turísticos, num aparthotel com piscinas exteriores, bar, e uma localização a poucos minutos da praia!\n\nPreço por noite',78.00,5,'object',NULL,21,'object'),
(98,'1','Product',38,'Hotel Quarteirasol ','Hotel Quarteirasol 4* - Praia de Quarteira | Escapadinha em Quarto Vista Mar com Jacuzzi Privado\n\nNo Algarve, noites com muito romance e paixão esperam por si. Surpreenda a sua cara-metade com uma experiência exclusiva!\n\nPreço por noite',89.00,5,'object',NULL,21,'object'),
(99,'1','Product',28,'Nozomi Sushi Bar','Nozomi Sushi Bar | 48 Peças de Sushi & Sangria de Espumante para Dois | Alcântara\n\nDesfrute dos sabores frescos e exóticos da cozinha japonesa no Nozomi Sushi Bar. Surpreenda-se com o combinado especial do Chef, composto por 40 peças!',32.00,22,'object',NULL,7,'object'),
(100,'1','Product',8,'Brunch a Dois Esquires','Brunch a Dois com Café Orgânico - Cheque Gourmet 20€ | Esquires Coffee - Porto\n\nApesar do café ser a grande paixão deste espaço, a comida feita na hora e confeccionada com ingredientes locais vai conquistar o seu coração!',17.00,6,'object',NULL,7,'object'),
(101,'1','Product',9,'Brunch a Dois Carcavelos','Brunch a Dois - Cheque Gourmet 20€ | Matcha - Carcavelos\n\nUma refeição fora de horas e generosa de sabores é o que lhe oferece o Matcha, situado no Mercado de Carcavelos. Desfrute em boa companhia!',15.00,22,'object',NULL,7,'object'),
(102,'1','Product',20,'KIN - Martim Moniz','Sabores & Tradições da Cozinha Asiática para Dois | KIN - Martim Moniz\n\nBasta ir até ao Martim Moniz, em Lisboa, e sentar-se numa das mesas do KIN para ser automaticamente transportado para a Ásia.',46.00,22,'object',NULL,7,'object'),
(103,'1','Product',6,'Bollywood Lounge','Com Amor, para Dois! Viagem Gastronómica no Bollywood Lounge | Marquês de Pombal\n\nNuma atmosfera elegante, sofisticada e mágica, enriqueça o seu paladar com os sabores vibrantes da Índia!',24.00,22,'object',NULL,7,'object'),
(104,'1','Product',24,'Mariscada','Mariscada com Tudo Incluído para Dois | Restaurante Alcazar - Viana do Castelo\n\nO Restaurante Alcazar propõe recebê-lo com uma grande mariscada! Desfrute dos sabores do mar!',45.00,6,'object',NULL,7,'object'),
(105,'1','Product',35,'Portofino Restaurante','Açorda de Camarão c/ Mexilhão para Dois com Vista Mar | Portofino Restaurante - Sesimbra\n\nSaboreie gastronomia requintada com sabor a mar enquanto tem uma vista privilegiada sobre a Praia do Ouro, em Sesimbra. Uma experiência a dois inesquecível!',39.00,22,'object',NULL,7,'object'),
(106,'1','Product',10,'Chefe Guiga Restaurant','Carnes Premium para Dois em Steakhouse em Lisboa | Chefe Guiga Restaurant\n\nO Chefe Guiga é uma steakhouse em Lisboa que vai surpreender os amantes de carne. Com vários cortes e acompanhamentos diferentes, é ideal para um jantar a dois.',39.00,22,'object',NULL,7,'object'),
