INSERT INTO `product_index` VALUES
(17,17,1,'1',4,'object',',,',',,','default',1,1,'Deeplyzen Day Spa','DeeplyZen Day Spa foi criado com a missão de permitir o cuidado da beleza, da saúde e do bem-estar, aliviando a tensão do dia a dia sem ter que sair da cidade. Também é para ajudar cada pessoa a encontrar seu equilíbrio pessoal, familiar e profissional.\n\n',59),
(18,18,1,'1',4,'object',',,',',,','default',1,1,'Taberna Belga','A melhor francesinha do norte\n\nA Francesinha e o nosso molho ímpar são os protagonistas da Taberna Belga.\n\nCom um sabor intenso e uma textura macia, a primeira garfada desta especialidade permite uma experiência singular e surpreendente.\n\nA escolha dos me',13),
(23,23,1,'1',4,'object',',,',',,','default',1,1,'Mariot Hotel','Um fim de semana para resuperar energias.\n\nPreço por noite',350),
(24,24,1,'1',4,'object',',,',',,','default',1,1,'Aquashow','O Aquashow Parque é o melhor e maior Parque Aquático e Parque Temático de Portugal, no Algarve, em Quarteira.\n\nEstamos abertos de 1 de Maio a 30 de Setembro a partir das 10h00, com horários de encerramento diferentes consoante o mês.\n\nNo Parque Aquático e',50),
(25,25,1,'1',4,'object',',,',',,','default',1,1,'Oceanário Lisboa','Oceanário de Lisboa - Uma Viagem Única ao Fundo do Mar\n\nUm presente para viver o oceano, “mergulhar” no fundo do mar, sentir o seu pulsar e a importância de algo maior - a conservação do oceano!',8),
(26,26,1,'1',4,'object',',,',',,','default',1,1,'Badoca Parque','O Badoca Safari Park é um parque temático com uma área de 90 hectares, que convida os amantes da natureza a passar um dia diferente e a conhecer a beleza da vida animal, em plena liberdade. Localizado no Alentejo, em Vila Nova de Santo André, entre a plan',50),
(27,27,1,'1',4,'object',',,',',,','default',1,1,'Bragalandia','Um parque tematico no norte do pais ,venha desfrutar um dia cheio de emoçoes',45),
(28,28,1,'1',4,'object',',,',',,','default',1,1,'Hotel Altura','Duas noites à beira mar, com pequeno almoco e almoco incluido.\n\nPreço por noite',350),
(29,29,1,'1',4,'object',',,',',,','default',1,1,'Sakana Sushi em Lisboa','Sakana Sushi em Lisboa | 50 Peças de Sushi e Sashimi com Vista Panorâmica Sobre o Tejo\n\nO sushi de qualidade, a vista deslumbrante sobre o Tejo, o ambiente intimista e informal, fazem do Sakana Sushi em Lisboa a opção certa para jantar romântico a dois.',35),
(30,30,1,'1',4,'object',',,',',,','default',1,1,'Termas do Gerês','O Termas & Spa do Gerês é constituído pelo Balneário Termal, recentemente reequipado e remodelado por um moderno spa. Para além da cura termal tradicional e dos programas terapêuticos, programas de prevenção e promoção da saúde, o Termas & Spa do Gerês di',23),
(31,31,1,'1',4,'object',',,',',,','default',1,1,'Scubadiving','Na zona costeira do algarve',40),
(32,32,1,'1',4,'object',',,',',,','default',1,1,'Workshop de Costura','Workshop de costura, aprenda a arte da costura.',15),
(69,69,1,'1',4,'object',',,',',,','default',1,1,'Naturwaterpark','O Naturwaterpark funciona de maio a setembro e tem vários espaços: parque aquático, parque aventura, quinta pedagógica e parque de campismo. O parque aquático tem pistas rápidas, o super-rápido Kamikaze, o Togobán com bóias, o hidrotubo, piscinas e o jacu',45),
(70,70,1,'1',4,'object',',,',',,','default',1,1,'Water Park Gerês','O Water Park Gerês é um parque de insufláveis na Praia do Alqueirão, albufeira da Caniçada. Tem o Iceberg que é escorrega com 4,2m e uma almofada (flipper) e um rolo de 6 metros sobre a água (hurdle). 6m em cima do rolo sem cair. Também tem flyboard e sta',12),
(71,71,1,'1',4,'object',',,',',,','default',1,1,'Slide and Splash','O Slide & Splash abriu em 1986 e é um do mais antigos parques aquáticos do país, ainda em funcionamento. Em todas as épocas traz novidades nas suas diversões. As atrações mais procuradas são o Kamikaze (tubos com 18 m de altura), o Torpedo (com 123 metros',17),
(72,72,1,'1',4,'object',',,',',,','default',1,1,'Jardim Zoologico Lisboa','Inaugurado em 1884, o Jardim Zoológico de Lisboa foi o primeiro parque com fauna e flora da Península Ibérica. Foram vários os seus fundadores - Dr. Pedro Van Der Laan, José Thomaz Sousa Martins e o Barão de Kessler - que contaram com o apoio de várias pe',24),
(73,73,1,'1',4,'object',',,',',,','default',1,1,'Zoomarine','Assiste a apresentações com golfinhos, focas e leões marinhos, aves tropicais, aves de rapina e espetáculos acrobáticos.\n\nMomentos de ligação com as várias espécies que vão garantir memórias que ficam para sempre.',1650),
(74,74,1,'1',4,'object',',,',',,','default',1,1,'Pena Aventura Park','O Pena Aventura Park e um parque de Actividades Ludicas e de Desporto Aventura/Natureza, onde a aventura nunca tem fim!E um destino único e uma referencia no Norte de Portugal, localizado em Ribeira de Pena, distrito de Vila Real, junto da saída da A7.',46),
(75,75,1,'1',4,'object',',,',',,','default',1,1,'Thai Way Spa','Massagem à escolha - Lenda Thai ou Magia Aromática.\nEstas massagens são inspiradas em tradições medicinais da Tailândia e vão levá-la a descobrir novas sensações de bem-estar!',32),
(76,76,1,'1',4,'object',',,',',,','default',1,1,'Pestana Spa','Magic Spa, experiencia de luxo c/ Circuito & Massagem |  2 Pessoas.\nTotalmente exclusivos e de excelência, os tratamentos dos Magic Spa by Pestana, fazem a diferença para quem procura um programa ideal para relaxar.',143),
(77,77,1,'1',4,'object',',,',',,','default',1,1,'El Spa - Hotel Melia Aeroporto','Circuito de Águas + Massagem Relax\n\nDesfrute de um momento wellness muito especial, a sós ou a dois. O presente ideal para quem não dispensa uma experiência de Spa!',25),
(78,78,1,'1',4,'object',',,',',,','default',1,1,'Neya Day Spa','Hidromassagem + Massagem Relax & Ritual de Chá\n\nNo requinte de um hotel de 4* em Lisboa, desfrute de uma inesquecível experiência de relaxamento e bem-estar no Neya Day Spa, sozinho ou a dois!',79),
(79,79,1,'1',4,'object',',,',',,','default',1,1,'Spa para Bebés','Opção Massagem | Bebé + Pais! For Your Baby - Spa, Care & Relax\n\nSono, choro e cólicas? O spa para bebés ajuda o seu filhote no alívio destes sintomas, enquanto relaxa e se diverte. Os papás podem acompanhar o bebé!',44),
(80,80,1,'1',4,'object',',,',',,','default',1,1,'Thalasso Spa','Acesso ao Circuito de Spa com Água do Mar\n\nNum cenário único, enquadrado pelo Atlântico, Thalasso é o local perfeito para reequilibrar o organismo e recuperar energias, em sintonia com o mar.',24),
(81,81,1,'1',4,'object',',,',',,','default',1,1,'Nuad Thai Massage Therapy','sessão de massagem à escolha entre: cabeça, pescoço e ombros; reflexologia nos pés; massagem zen relaxante;\n\nFuja à agitação da cidade e entre num retiro de relaxamento e bem-estar que vai renovar as suas energias.',29),
(82,82,1,'1',4,'object',',,',',,','default',1,1,'Mandalay Spa','Especial Pré-Mamã! Massagem para Grávida.\nDesligue-se de todas as preocupações e agitações do quotidiano, aproveitando ao máximo esta fase tão especial da sua vida.',42),
(83,83,1,'1',4,'object',',,',',,','default',1,1,'Passeio pelo Douro','Passeio pelo Douro com Almoço a Bordo | Porto-Régua-Porto com Subida de Barco\n\nAlém de paisagens deslumbrantes, está incluído o pequeno-almoço, o almoço e um imenso prazer de passear por este rio Património Mundial!',62),
(84,84,1,'1',4,'object',',,',',,','default',1,1,'Pack SLB','Pack SLB: Visita ao Museu e ao Estádio da Luz + Oferta de Cachecol\n\nUma visita ao Estádio da Luz e/ou Museu do Benfica com oferta de cachecol é o presente ideal para oferecer ao maior benfiquista que conhece!',10),
(85,85,1,'1',4,'object',',,',',,','default',1,1,'Cruzeiro das 6 Pontes do Douro','Cruzeiro das 6 Pontes do Douro com Jantar a Bordo para Dois | RentDouro\n\nAdmire as seis pontes que unem o Porto e Vila Nova de Gaia ao sabor de um magnífico jantar a bordo.',59),
(86,86,1,'1',4,'object',',,',',,','default',1,1,'Portugal dos Pequenitos','Portugal dos Pequenitos em Coimbra | Entradas Para Toda a Família!\n\nO Portugal dos Pequenitos, em Coimbra, é um espaço lúdico e pedagógico de cariz histórico muito agradável e divertido para passar um dia em família!',9),
(87,87,1,'1',4,'object',',,',',,','default',1,1,'HIPPOtrip','HIPPOtrip | Passeio em Lisboa em Veículo Anfíbio com \"Mergulho\" no Rio Tejo\n\nÉ um barco e um autocarro! É o HIPPOtrip! Descubra Lisboa em família e prepare-se para \"mergulhar” no rio Tejo com um enorme sorriso!',29),
(88,88,1,'1',4,'object',',,',',,','default',1,1,'Workshop Vínico','Workshop Vínico c/ Degustação & Visita à Adega Mayor para Dois | Campo Maior\n\nAlém da visita à Adega Mayor, esta experiência inclui um workshop de introdução ao mundo dos vinhos, com degustação de várias iguarias regionais.',32),
(89,89,1,'1',4,'object',',,',',,','default',1,1,'Passeio Romântico a Cavalo','Passeio Romântico a Cavalo na Praia com Opção Sessão Fotos | 1h30 em Privado para Dois - Sines\n\nUm passeio a cavalo na praia privado é a sugestão ideal para surpreender a sua cara-metade! A Praia do Norte em Sines oferece o cenário romântico perfeito!',109),
(90,90,1,'1',4,'object',',,',',,','default',1,1,'Visita e Prova de Vinho ','Visita e Prova de Vinho + Cruzeiro 3h30 | Macedo de Cavaleiros\n\nAproveite para fazer uma prova de vinhos e relaxar num cruzeiro pela Albufeira do Azibo com a sua família. Mime-se e embarque neste aventura vitivinícola!',35),
(91,91,1,'1',4,'object',',,',',,','default',1,1,'Vinyl M Hotel','Vinyl M Hotel - Aveiro | Estadia com Banheira de Hidromassagem & Opção Pack Romântico\n\nO Vinyl M Hotel convida-o a usufruir do seu ambiente versátil, proporcionando conforto e prazer, integrando diferentes estilos de acordo com o seu perfil.\n\nPreço por no',40),
(92,92,1,'1',4,'object',',,',',,','default',1,1,'Hotel Eden','Hotel Eden - Luso | Estadia de Romance Junto às Termas\n\nCom a beleza da Serra do Buçaco e a vitalidade das termas conjugadas, no Luso encontra uma estadia que despertará todos os seus sentidos!\n\nPreço por noite',55),
(93,93,1,'1',4,'object',',,',',,','default',1,1,'Quinta da Malhada','Quinta da Malhada - Vale do Paiva | Estadia Rústica em Casa de Xisto com Opção Pack Romântico\n\nNesta quinta encontrará um refúgio com toda a privacidade para uma escapadinha rural a dois ou em família!\n\nPreço por noite',45),
(94,94,1,'1',4,'object',',,',',,','default',1,1,'Hotel Agrinho Suites & Spa','Hotel Agrinho Suites & Spa - Gerês | Estadia Romântica com Opção Jantar\n\nA poucos passos do Parque Nacional da Peneda-Gerês, o Hotel Agrinho Suites & Spa é a unidade perfeita para umas férias na natureza sem que falte o conforto e o requinte\n\nPreço por no',67),
(95,95,1,'1',4,'object',',,',',,','default',1,1,'Axis Ponte de Lima Golf Resort Hotel ','Axis Ponte de Lima Golf Resort Hotel | Escapadinha a Dois com Piscina Interior\n\nVisite o Minho em clima de romance! Convide quem mais ama e percam-se numa estadia de bem-estar e contacto com a natureza.\n\nPreço por noite',78),
(96,96,1,'1',4,'object',',,',',,','default',1,1,'Grand Muthu Forte da Oura','Grand Muthu Forte da Oura 5* - Albufeira | Noites em Família com Tudo Incluído Junto à Praia\n\nDesfrute de uma estadia sossegada no Algarve. Um paraíso para toda a família, a poucos passos da praia!\n\nPreço por noite',109),
(97,97,1,'1',4,'object',',,',',,','default',1,1,'Pelican Alvor','Pelican Alvor 4* | Férias em Família em Estúdio Vista Piscina & Opção Pequeno-Almoço\n\nViva o Algarve longe dos grandes centros turísticos, num aparthotel com piscinas exteriores, bar, e uma localização a poucos minutos da praia!\n\nPreço por noite',78),
(98,98,1,'1',4,'object',',,',',,','default',1,1,'Hotel Quarteirasol ','Hotel Quarteirasol 4* - Praia de Quarteira | Escapadinha em Quarto Vista Mar com Jacuzzi Privado\n\nNo Algarve, noites com muito romance e paixão esperam por si. Surpreenda a sua cara-metade com uma experiência exclusiva!\n\nPreço por noite',89),
(99,99,1,'1',4,'object',',,',',,','default',1,1,'Nozomi Sushi Bar','Nozomi Sushi Bar | 48 Peças de Sushi & Sangria de Espumante para Dois | Alcântara\n\nDesfrute dos sabores frescos e exóticos da cozinha japonesa no Nozomi Sushi Bar. Surpreenda-se com o combinado especial do Chef, composto por 40 peças!',32),
(100,100,1,'1',4,'object',',,',',,','default',1,1,'Brunch a Dois Esquires','Brunch a Dois com Café Orgânico - Cheque Gourmet 20€ | Esquires Coffee - Porto\n\nApesar do café ser a grande paixão deste espaço, a comida feita na hora e confeccionada com ingredientes locais vai conquistar o seu coração!',17),
(101,101,1,'1',4,'object',',,',',,','default',1,1,'Brunch a Dois Carcavelos','Brunch a Dois - Cheque Gourmet 20€ | Matcha - Carcavelos\n\nUma refeição fora de horas e generosa de sabores é o que lhe oferece o Matcha, situado no Mercado de Carcavelos. Desfrute em boa companhia!',15),
(102,102,1,'1',4,'object',',,',',,','default',1,1,'KIN - Martim Moniz','Sabores & Tradições da Cozinha Asiática para Dois | KIN - Martim Moniz\n\nBasta ir até ao Martim Moniz, em Lisboa, e sentar-se numa das mesas do KIN para ser automaticamente transportado para a Ásia.',46),
(103,103,1,'1',4,'object',',,',',,','default',1,1,'Bollywood Lounge','Com Amor, para Dois! Viagem Gastronómica no Bollywood Lounge | Marquês de Pombal\n\nNuma atmosfera elegante, sofisticada e mágica, enriqueça o seu paladar com os sabores vibrantes da Índia!',24),
(104,104,1,'1',4,'object',',,',',,','default',1,1,'Mariscada','Mariscada com Tudo Incluído para Dois | Restaurante Alcazar - Viana do Castelo\n\nO Restaurante Alcazar propõe recebê-lo com uma grande mariscada! Desfrute dos sabores do mar!',45),
(105,105,1,'1',4,'object',',,',',,','default',1,1,'Portofino Restaurante','Açorda de Camarão c/ Mexilhão para Dois com Vista Mar | Portofino Restaurante - Sesimbra\n\nSaboreie gastronomia requintada com sabor a mar enquanto tem uma vista privilegiada sobre a Praia do Ouro, em Sesimbra. Uma experiência a dois inesquecível!',39),
(106,106,1,'1',4,'object',',,',',,','default',1,1,'Chefe Guiga Restaurant','Carnes Premium para Dois em Steakhouse em Lisboa | Chefe Guiga Restaurant\n\nO Chefe Guiga é uma steakhouse em Lisboa que vai surpreender os amantes de carne. Com vários cortes e acompanhamentos diferentes, é ideal para um jantar a dois.',39),
(108,108,1,'1',4,'object',',,',',,','default',1,1,'Kartódromo de Évora','Acelere no Kartódromo de Évora! Kart de 270cc - 30 Min.\n\nSinta a adrenalina a correr-lhe nas veias num verdadeiro kart de corrida! Acelere (sempre com segurança) no Kartódromo de Évora!',25);
